const fetch = require('node-fetch');
const fs = require('fs');
const path = require('path');

// assuming `data` is your full API response
async function downloadInstagramVideos(data) {
    const posts = data?.data?.xdt_api__v1__feed__user_timeline_graphql_connection?.edges || [];

    for (const { node } of posts) {
        if (!node?.video_versions) continue;

        // Prefer 720p if available
        const video = node.video_versions.find(v => v.width === 720) || node.video_versions[0];
        const poster = node.image_versions2?.candidates?.[0]?.url;
        const reelCode = node.code;
        const videoUrl = video?.url;
         
        if (!videoUrl) continue;

        try {
            const res = await fetch(poster);
            const fileStream = fs.createWriteStream(path.join(__dirname, 'reels/posters', `${reelCode}.jpg`));
            console.log(`üîΩ Downloading ${reelCode} from ${videoUrl}`);
            await new Promise((resolve, reject) => {
                res.body.pipe(fileStream);
                res.body.on("error", reject);
                fileStream.on("finish", resolve);
            });

            console.log(`‚úÖ Done: ${reelCode}.mp4`);
        } catch (err) {
            console.error(`‚ùå Error downloading ${reelCode}:`, err.message);
        }
    }
}

// ‚ö†Ô∏è Just for demo, call the function with dummy `data`
downloadInstagramVideos(data);
